from unittest import TestCase
from embit.liquid.psetview import PSETView, GlobalLTransactionView
from embit.liquid.pset import PSET
from embit.liquid.transaction import LTransaction
from embit import bip32, bip39
from binascii import a2b_base64, b2a_base64
from io import BytesIO

ROOT = bip32.HDKey.from_seed(
    bip39.mnemonic_to_seed(
        "about about about about about about about about about about about abuse"
    )
)

PSETS = [
    "",
    "",
    "",
]


class PSETViewTest(TestCase):
    def test_scopes(self):
        for psetb64 in PSETS:
            pset = PSET.from_string(psetb64)
            raw = pset.tx.serialize()
            tx = LTransaction.parse(raw)

            b = BytesIO(raw)
            tv = GlobalLTransactionView(b, 0)
            self.assertEqual(tv.num_vin, len(tx.vin))
            self.assertEqual(tv.num_vout, len(tx.vout))
            for i, inp in enumerate(tx.vin):
                self.assertEqual(inp.serialize(), tv.vin(i).serialize())

            for i, out in enumerate(tx.vout):
                self.assertEqual(out.serialize(), tv.vout(i).serialize())

            self.assertEqual(tx.locktime, tv.locktime)
            self.assertEqual(tx.version, tv.version)

            b = BytesIO(a2b_base64(psetb64))
            pv = PSETView.view(b)

            for i, inp in enumerate(pset.inputs):
                self.assertEqual(inp.serialize(), pv.input(i).serialize())

            for i, out in enumerate(pset.outputs):
                self.assertEqual(out.serialize(), pv.output(i).serialize())

            bb = BytesIO()
            pv.write_to(bb)
            self.assertEqual(bb.getvalue(), pset.serialize())

    def test_sign(self):
        """Test if we can sign psetview and get the same as from signing psbt"""
        psetb64 = ""
        raw = a2b_base64(psetb64)
        pset = PSET.from_string(psetb64)
        pset.sign_with(ROOT)

        b = BytesIO(raw)
        pv = PSETView.view(b)
        sigs = BytesIO()
        pv.sign_with(ROOT, sigs)
        bb = BytesIO()
        sigs.seek(0)
        pv.write_to(bb, extra_input_streams=[sigs])
        self.assertEqual(bb.getvalue(), pset.serialize())
